print(repr(list(names_to_reps.keys())))


rooms_db = '/var/jail/home/team49/room_info.db'
leaderboard_db = '/var/jail/home/team49/leaderboard.db'
current_games_db = '/var/jail/home/team49/current_games.db'

def request_handler(request):
    username = ''
    roomname = ''
    password = ''
    if request["method"] == "GET":
        try:
            action = request["values"]["action"]
        except Exception as e:
            return "Invalid username"
        if action == "lobby":
            try:
                username = request['values']['user']
            except Exception as e:
                return "Invalid username"
            if len(username) > 16 or len(username) < 1: return "Please provide a nonempty username with no more than 16 characters"
            with sqlite3.connect(rooms_db) as c:
                c.execute('''CREATE TABLE IF NOT EXISTS rooms_table (roomname text, password text, host text, player2 text, player3 text, player4 text, player5 text, ingame integer, host_play integer, player2_play integer, player3_play integer, player4_play integer, player5_play integer, start_time real);''')
                all_rooms =  c.execute('''SELECT * FROM rooms_table''').fetchall()
                room_list = 'All rooms:'
                for room in all_rooms:
                    if username in room:
                        if room[7]:
                            return "Readying up..."
                    is_full = True
                    for i in range(2,7):
                        if not room[i]:
                            is_full = False
                        if room[i] == username:
                            current_room = "Current room: " + room[0] + "\n"
                            current_room += "Players:"
                            for j in range(2,7):
                                if room[j]:
                                    current_room += "\n" + room[j]
                                    if j == 2:
                                        current_room += " (Host)"
                            return current_room
                    room_list += "\n" + room[0]
                    if room[1]:
                        room_list += " - Private"
                    else:
                        room_list += " - Public"
                    if room[7]:
                        room_list += " (IN GAME)"
                    elif is_full:
                        room_list += " (FULL)"
                if not all_rooms: return "No rooms to join..."
                return room_list
        elif action == "leaderboard":
            with sqlite3.connect(leaderboard_db) as c:
                c.execute("""CREATE TABLE IF NOT EXISTS leaderboards (name text, song text, instruments text, score real);""")
                try:
                    song = request["values"]["song"]
                    song_name = song.replace(" ", "_").lower()
                    # return "item done"
                    instruments = request["values"]["instruments"]
                    # return "value done"
                except Exception as e:
                    return "Error: Missing GET Headers Now!"
                unupdated_leaderboard = c.execute("""SELECT * FROM leaderboards WHERE instruments=? AND song=? ORDER BY score DESC;""", (instruments, song_name)).fetchall()

                string_to_return = "LEADERBOARD for " + song + " with " + instruments + ":\n"
                for i in range(min(10,len(unupdated_leaderboard))):
                    string_to_return += str(i+1) + ".) " + str(unupdated_leaderboard[i][0]) + " => " + str(unupdated_leaderboard[i][3]) + " points\n"

                return string_to_return
        elif action == "personalleaderboard":
            with sqlite3.connect(leaderboard_db) as c:
                c.execute("""CREATE TABLE IF NOT EXISTS leaderboards (name text, song text, instruments text, score real);""")
                try:
                    # return request
                    action = request["values"]["action"]
                    # return "user done"
                    name = request["values"]["user"]
                    # return "value done"
                except Exception as e:
                    return "Error: Missing GET Headers Now!"

                leaderboard = c.execute("""SELECT * FROM leaderboards WHERE name=? ORDER BY score DESC;""", (name,)).fetchall()

                score_map = {}
                for i in leaderboard:
                    if (i[1] not in score_map.keys()):
                        score_map[i[1]] = i

                string_to_return = "HIGH SCORES FOR " + name + ":\n"
                for i in score_map.keys():
                    string_to_return += i + " on " + score_map[i][2] + " => " + str(score_map[i][3]) + " points\n"

                return string_to_return
        elif action == "currentgames":
            with sqlite3.connect(current_games_db) as c:
                c.execute("""CREATE TABLE IF NOT EXISTS current_games (name text, song text, instruments text, difficulty text);""")

                currentgs = c.execute("""SELECT * FROM current_games;""").fetchall()

                string_to_return = "\nCURRENT GAMES:\n"
                for i in currentgs:

                    string_to_return += "-----\nUser: " + i[0] + "\n" + "Song: " + i[1] + " \nInstrument: " + i[2] + "\nDifficulty: " + i[3] + "\n-----\n\n"

                return string_to_return

        return "Please submit a correct GET request."


    elif request["method"] == "POST":
        try:
            action = request['form']['action']
        except Exception as e:
            return "Invalid username, roomname, password, and/or action"
        if (action in ["create", "join", "leave", "ready", "play", "waiting"]):
            with sqlite3.connect(rooms_db) as c:
                try:
                    username = request['form']['user']
                    roomname = request['form']['roomname']
                    password = request['form']['password']
                    action = request['form']['action']
                except Exception as e:
                    return "Invalid username, roomname, password, and/or action"
                if len(username) > 16 or len(username) < 1: return "Please provide a nonempty username with no more than 16 characters"
                if len(roomname) > 16 or len(roomname) < 1 : return "Please provide a nonempty room name with no more than 16 characters"
                if len(password) > 16: return "Please provide a password with no more than 16 characters"
                if len(action) < 1: return "Please provide a nonempty action"

                c.execute('''CREATE TABLE IF NOT EXISTS rooms_table (roomname text, password text, host text, player2 text, player3 text, player4 text, player5 text, ingame integer, host_play integer, player2_play integer, player3_play integer, player4_play integer, player5_play integer, start_time real);''')
                all_rooms =  c.execute('''SELECT * FROM rooms_table''').fetchall()
                if action == 'create':
                    for room in all_rooms:
                        if username in room:
                            return "You have already created a room"
                    is_available = True
                    for room in all_rooms:
                        if room[0] == roomname:
                            is_available = False
                            break
                    if is_available:
                        c.execute('''INSERT into rooms_table VALUES (?,?,?,?,?,?,?,?,?,?,?,?,?,?);''',
                                 (roomname, password, username, None, None, None, None, 0, 0, None, None, None, None, None))
                        pub_or_priv = 'private' if password else 'public'
                        return "Sucessfully created " + pub_or_priv + " room " + roomname
                    else:
                        return "Roomname is already taken"
                elif action == 'join':
                    for room in all_rooms:
                        if username in room:
                            return "You are already in a room"
                    for room in all_rooms:
                        if room[0] == roomname:
                            if room[7]:
                                return "This room is already in a game"
                            if not room[1] or password == room[1]:
                                room_copy = room
                                for i in range(2,7):
                                    if not room_copy[i]:
                                        room_copy = room_copy[:i] + (username,) + room_copy[i+1:]
                                        c.execute('''DELETE FROM rooms_table WHERE roomname LIKE '%s';'''%(room_copy[0]))
                                        c.execute('''INSERT into rooms_table VALUES (?,?,?,?,?,?,?,?,?,?,?,?,?,?);''',
                                                 (room_copy[0], room_copy[1], room_copy[2], room_copy[3], room_copy[4], room_copy[5], room_copy[6], room_copy[7],
                                                  room_copy[8], room_copy[9], room_copy[10],room_copy[11],room_copy[12],room_copy[13]))
                                        return "Sucessfully joined " + room_copy[0]
                                return room_copy[0] + " is full"
                            return "Incorrect password"
                    return "Room name does not exist"
                elif action == 'leave':
                    for room in all_rooms:
                        if username in room:
                            if room[7]:
                                return "You cannot leave in the middle of a game"
                            room_copy = room
                            is_empty = True
                            is_host = False
                            delete_idx = 0
                            for i in range(2,7):
                                if room_copy[i] == username:
                                    delete_idx = i
                                    if i == 2: is_host = True
                                elif room_copy[i] != None:
                                    is_empty = False
                            c.execute('''DELETE FROM rooms_table WHERE roomname LIKE '%s';'''%(room_copy[0]))
                            if is_empty:
                                return "Left " + room_copy[0] + " (Room deleted)"
                            if is_host:
                                for i in range(3,7):
                                    if room_copy[i]:
                                        room_copy = (room_copy[0], room_copy[1]) + (room_copy[i],) + room_copy[3:i] + (None,) + room_copy[i+1:]
                                        break
                            else:
                                room_copy = room_copy[:delete_idx] + (None,) + room_copy[delete_idx+1:]
                            c.execute('''INSERT into rooms_table VALUES (?,?,?,?,?,?,?,?,?,?,?,?,?,?);''',
                                     (room_copy[0], room_copy[1], room_copy[2], room_copy[3], room_copy[4], room_copy[5], room_copy[6], room_copy[7],
                                      room_copy[8], room_copy[9], room_copy[10],room_copy[11],room_copy[12],room_copy[13]))
                            return "Left " + room_copy[0]
                    return "You must be in a room in order to leave"
                elif action == 'ready':
                    for room in all_rooms:
                        if username in room:
                            if room[2] == username:
                                room_copy = room
                                c.execute('''DELETE FROM rooms_table WHERE roomname LIKE '%s';'''%(room_copy[0]))
                                c.execute('''INSERT into rooms_table VALUES (?,?,?,?,?,?,?,?,?,?,?,?,?,?);''',
                                     (room_copy[0], room_copy[1], room_copy[2], room_copy[3], room_copy[4], room_copy[5], room_copy[6], 1,
                                      room_copy[8], room_copy[9], room_copy[10],room_copy[11],room_copy[12],room_copy[13]))
                                return "Readying up..."
                            else:
                                return "Only the host can ready up"
                    return "You must be the host of a room in order to ready up"
                elif action == 'play':
                    for room in all_rooms:
                        if username in room:
                            play_idx = 0
                            existing_index = []
                            for i in range(2,7):
                                if room[i] == username:
                                    play_idx = i+6
                                if room[i]:
                                    existing_index.append(i)
                            room_copy = room[:play_idx] + (1,) + room[play_idx+1:]
                            c.execute('''DELETE FROM rooms_table WHERE roomname LIKE '%s';'''%(room_copy[0]))
                            c.execute('''INSERT into rooms_table VALUES (?,?,?,?,?,?,?,?,?,?,?,?,?,?);''',
                                 (room_copy[0], room_copy[1], room_copy[2], room_copy[3], room_copy[4], room_copy[5], room_copy[6], room_copy[7],
                                  room_copy[8], room_copy[9], room_copy[10],room_copy[11],room_copy[12],room_copy[13]))
                            all_play = True
                            for idx in existing_index:
                                if not room_copy[idx+6]:
                                    all_play = False
                                    break
                            if all_play:
                                conn = sqlite3.connect(rooms_db)
                                c = conn.cursor()
                                c.execute('''DELETE FROM rooms_table WHERE roomname LIKE '%s';'''%(room_copy[0]))
                                c.execute('''INSERT into rooms_table VALUES (?,?,?,?,?,?,?,?,?,?,?,?,?,?);''',
                                     (room_copy[0], room_copy[1], room_copy[2], room_copy[3], room_copy[4], room_copy[5], room_copy[6], room_copy[7],
                                      room_copy[8], room_copy[9], room_copy[10], room_copy[11], room_copy[12], time.time()+5))
                            return 'Waiting...'
                elif action == 'waiting':
                    for room in all_rooms:
                        if username in room:
                            if room[13]:
                                return str(int((room[13] - time.time())*1000))
                            else:
                                return "Waiting..."
                return "Please choose if you want to create, join, or leave a room"
        elif (action == "leaderboard"):
            with sqlite3.connect(leaderboard_db) as c:
                try:
                    action = request["form"]["action"]

                    name = request['form']['user']
                    # return "user done"
                    song = request["form"]["song"]
                    song_name = song.replace(" ", "_").lower()
                    # return "item done"
                    instruments = request["form"]["instruments"]
                    # return "action done"
                    score = int(request["form"]["score"])
                    # return "value done"
                except Exception as e:
                    # return e here or use your own custom return message for error catch
                    #be careful just copy-pasting the try except as it stands since it will catch *all* Exceptions not just ones related to number conversion.
                    return "Error: Missing one of the fields from the request are missing or not numbers"
                c.execute("""CREATE TABLE IF NOT EXISTS leaderboards (name text, song text, instruments text, score real);""")
                unupdated_leaderboard = c.execute("""SELECT * FROM leaderboards WHERE instruments=? AND song=? ORDER BY score DESC;""", (instruments, song_name)).fetchall()

                position_of_attempt = len(unupdated_leaderboard)
                i=0
                for i in range(len(unupdated_leaderboard)):
                    if (unupdated_leaderboard[i][3] < score):
                        break

                position_of_attempt = i - 1

                c.execute('''INSERT into leaderboards VALUES (?,?,?, ?);''', (name, song_name, instruments, score))

                unupdated_leaderboard = c.execute("""SELECT * FROM leaderboards WHERE instruments=? AND song=? ORDER BY score DESC;""", (instruments, song_name)).fetchall()

                string_to_return = "LEADERBOARD for " + song + " with " + instruments + ":\n"
                for i in range(min(10,len(unupdated_leaderboard))):
                    string_to_return += str(i+1) + ".) " + str(unupdated_leaderboard[i][0]) + " => " + str(unupdated_leaderboard[i][3]) + " points\n"

                if position_of_attempt > 9:
                    string_to_return += str(position_of_attempt + 1) + ".) " + name + " => " + str(score) + " points\n"

                return string_to_return
        elif (action == "startgame"):
            try:
                # return "user done"
                name = request["form"]["user"]
                # return "value done"
                song_name = request["form"]["song"].replace(" ", "_").lower()
                instrument = request["form"]["instrument"]
                difficulty = request["form"]["difficulty"]
            except Exception as e:
                return "Error: Missing GET Headers Start!!"
            with sqlite3.connect(current_games_db) as c:
                c.execute("""CREATE TABLE IF NOT EXISTS current_games (name text, song text, instrument text, difficulty text);""")

                c.execute('''INSERT into current_games VALUES (?,?,?, ?);''', (name, song_name, instrument, difficulty))

                esp_song_name = song_name + "_" + instrument.lower() + "_" + difficulty.lower()

                return names_to_reps[esp_song_name]
        elif (action == "endgame"):
            try:
                # return "user done"
                name = request["form"]["user"]
            except Exception as e:
                return "Error: Missing GET Headers Now!"
            with sqlite3.connect(current_games_db) as c:
                c.execute("""CREATE TABLE IF NOT EXISTS current_games (name text, song text, instrument text, difficulty text);""")

                c.execute('''DELETE FROM current_games WHERE name = ?;''', (name,))

                return "Congrats on Completing your Game!"
        return "Please Submit a correct POST request."
